`
export const NavbarContainer = styled.div` 
    display : flex;
    justify-content : space-betweeen;
    height : 80px;
    z-index : 1px;
    width : 100%;
    padding : 0 24px;
    max-width : 1100px; 
`
export const NavbarMenu = styled.ul` 
    display : flex;
